import React from "react";
import { useGallery } from "../../contexts/galleryContext";

const CartList = () => {
  const { cartItems, removeFromCart } = useGallery();
  return (
    <div className="py-10 px-5 flex flex-col gap-y-7 items-start">
      {cartItems.length > 0 &&
        cartItems.map((item) => (
          <div
            key={item.id}
            className="flex items-center justify-between gap-x-5"
          >
            <img
              src={item.url}
              alt=""
              className="w-10 h-10 object-cover rounded-full"
            />
            <button className="p-3 rounded-lg bg-red-400 text-white font-semibold text-sm" onClick={()=> re}>
              Delete
            </button>
          </div>
        ))}
    </div>
  );
};

export default CartList;
